import React from "react";
import { Link } from "react-router-dom";

function Navbar() {
  return (
    <nav className="navbar">
      <Link to="/" >Quiz App</Link>
      <Link to="/login" >Login</Link>
      <Link to="/register" >Register</Link>
    </nav>
  );
}

export default Navbar;
